import React from 'react'
import { useTranslation } from "react-i18next";



function Home() {

  const { t, i18n } = useTranslation();


  return (
    <div className="App">
    <div className="App-header">
      <h1>Hola soy {t('homePage.title')}</h1>


    </div>
  </div>
  )
}

export default Home
